import React from "react";
import { useState } from "react";
import { useNavigate } from "react-router-dom";

const EditExpenseModal = ({
  isOpen,
  closeModal,
  userId,
  expenseFolderId,
  navLink,
  expense,
}) => {
  const [newExpense, setNewExpense] = useState({
    user_Id: userId,
    expenseFolder_Id: expenseFolderId,
    title: "",
    amount: null,
    category: "",
    desc: "",
    date: "",
  });

  const navigation = useNavigate();

  const handleChange = (e) => {
    e.preventDefault();
    setNewExpense((prevExpense) => ({
      ...prevExpense,
      [e.target.name]: e.target.value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
  };

  const handleDelete = (e) => {
    e.preventDefault();
  };

  // this function will handle clicks inside the modal content
  const handleContentClick = (e) => {
    e.stopPropagation(); // Prevents the click event from propagating to the overlay
  };

  const handleOutsideModalClick = (e) => {
    e.preventDefault();
    closeModal(false);
    if (navLink) {
      navigation(navLink);
    }
  };

  return (
    <div
      className={`modal ${isOpen ? "open" : ""}`}
      onClick={handleOutsideModalClick}
    >
      <div className="modal-overlay">
        <div className="modal-content" onClick={handleContentClick}>
          <div className="modal-title-container">
            <h1 className="modal-title">Expense</h1>
          </div>

          <div className="modal-form-container">
            <form className="modal-form" onSubmit={handleSubmit}>
              <div className="container">
                <label>Name:</label>
                <div className="model-form-input-container">
                  <input
                    type="text"
                    name="title"
                    value={expense.title}
                    onChange={handleChange}
                  />
                </div>
              </div>

              <div className="container">
                <label>Amount:</label>
                <div className="model-form-input-container">
                  <input
                    type="number"
                    name="amount"
                    step=".01"
                    value={expense.amount.toFixed(2)}
                    onChange={handleChange}
                  />
                </div>
              </div>

              <div className="container">
                <label>Category:</label>
                <div className="model-form-input-container">
                  <input
                    type="text"
                    name="category"
                    value={expense.category}
                    onChange={handleChange}
                  />
                </div>
              </div>

              <div className="container">
                <label>Description:</label>
                <div className="model-form-input-container">
                  <input
                    type="text"
                    name="desc"
                    value={expense.desc}
                    onChange={handleChange}
                  />
                </div>
              </div>

              <div className="container">
                <label>Date:</label>
                <div className="model-form-input-container">
                  <input
                    type="date"
                    name="date"
                    value={expense.date}
                    onChange={handleChange}
                  />
                </div>
              </div>

              <div className="modal-button-container">
                <button className="modal-button" type="submit">
                  Edit
                </button>

                <button className="modal-button" onClick={handleDelete}>
                  Delete
                </button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default EditExpenseModal;
